import React, {useState,useEffect} from 'react';
import axios from 'axios';

const Sapling=()=>{
const [plant,setPlant]=useState([]);

useEffect(() => {
    const Response=async()=>{
        const {data}=await axios.get('http://127.0.0.1:8000/api/sapling/');

        console.log(data)
        setPlant(data)
    };
    Response()
    
}, [])
console.log(plant)



const sap=plant.map((x,index)=>{
    return (
        <div  className="card" key={index}>
            <div className="c"> 
            <h3>{x.event}</h3>
            <img src={x.image1} alt="sapp0" style={{heigth:'160px',width:'160px',objectFit:'cover',borderRadius:'10px'}}/>
            <p>{x.count}</p>
            <p>{x.About}</p>
            <p>{x.year}</p>
            </div>
        </div>
    )
})


    return  (
        <div className='container'>
        <div className="card1">
        {sap}</div>
        </div>
    )
}

export default Sapling;
